import React from 'react';

const logoStyle = {
  display: 'flex',
  alignItems: 'center',
  gap: '15px',
};

const logoTextStyle = {
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  width: '50px',
  height: '50px',
  backgroundColor: '#1e40af',
  color: '#ffffff',
  textAlign: 'center',
  lineHeight: '50px',
  borderRadius: '50%',
  fontSize: '24px',
  fontWeight: '600',
  boxShadow: '0 2px 4px rgba(0, 0, 0, 0.2)',
};

const nameStyle = {
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
};

const nameHeaderStyle = {
  fontSize: '1.8rem',
  color: '#ffffff',
  fontWeight: '700',
  textTransform: 'uppercase',
};

const nameSubHeaderStyle = {
  fontSize: '1.2rem',
  color: '#d3d3d3',
  fontWeight: '500',
  textTransform: 'uppercase',
  marginTop: '5px',
};

const logoImageStyle = {
  width: '50px',
  height: '50px',
  borderRadius: '50%',
  objectFit: 'cover',
};

const HeaderLogo = () => {
  return (
    <div style={logoStyle}>
      {/* Image Logo */}
      <img src="https://via.placeholder.com/50" alt="Logo" style={logoImageStyle} />
      
      {/* Text-based Logo */}
      <div style={nameStyle}>
        <h2 style={nameHeaderStyle}>Akshay Balte</h2>
        <p style={nameSubHeaderStyle}>Web Developer</p>
      </div>
    </div>
  );
};

export default HeaderLogo;
